function work(e){const a=[2,0,1];let r=1;for(;-1!==r;)switch(a[r]){case 1:for(var c=0;c<20;c++){switch((s=(3*s+c)%97)%2==0?s+=c:s-=c,s%3){case 0:s+=7;break;case 1:s+=11;break;default:s+=13}s>1e3&&(s%=97)}r=0;break;case 2:return s;case 0:var s=e%97;r=2;break;default:r=-1}}function bench(e){const a=[2,0,1];let r=1;for(;-1!==r;)switch(a[r]){case 0:var c=0;r=2;break;case 2:return c;case 1:for(var s=0;s<e;s++)c+=work(s);r=0;break;default:r=-1}}globalThis.bench=bench;